import React from "react";

const InfoAboutMe = "I am undergraduate student of geoinformatics at Warsaw University of Technology but due to my desire" +
    " to increase the knowledge I spent plenty of my leisure to explore and learn C++. " +
    "I started taking a real interest in programming in middle school. I began in Front-End due to the greater affordability and quantity of materials available. " +
    "Thanks to this I became involved in programming and I continue my studies in this field. <p>I really like facing new problems and I will not rest until I solve them. " +
    "I am great at teamwork and consistently fulfill my duties. I learn very quickly and enjoy deepening my knowledge.</p>";

export default InfoAboutMe;
